import { Component, OnInit } from '@angular/core';
import { UserService } from '../user.service';

@Component({
  selector: 'app-dashboard',
  templateUrl: './dashboard.component.html',
  styleUrls: ['./dashboard.component.css'],
})
export class DashboardComponent implements OnInit {

  currentUser !: string;

  constructor(private userService: UserService) {}

  ngOnInit(): void {

    this.getCurrentUser();
  }

  getCurrentUser() {
    this.userService.getCurrentUser().subscribe(
      (username) => {
        this.currentUser = username;
      },
      (error) => {
        console.log('Error', error);
      }
    );
  }


  getUser() {
    this.userService.getUser().subscribe(
      (user) => {
        console.log('from dashboard component all user', user);
      },
      (error) => {
        console.log('Error' + error);
      }
    );
  }
}

<div class="bootstrap-wrapper">
    <div class="container text-center mt">
        <h1>Welcome to Admin Panel</h1>
        <button (click)="getCurrentUser()" mat-raised-button>Get Current User</button> <br><br>
        <h1 *ngIf="user">user is {{username}} </h1>
        <button (click)="getUser()" mat-raised-button>Get Details</button>



        <div *ngIf="currentUser">
            <p>Welcome, {{ currentUser }}!</p>
          </div>


    </div>
</div>
